import React, { useState, useEffect } from "react";
import Card from "../shared/UIElements/Card";
const SearchResults = ({ searchList }) => {
  return (
    <div className="Container">
      {searchList &&
        searchList.map((item) => (
          <Card>
            <div>{item.name}</div>
          </Card>
        ))}
    </div>
  );
};

export default SearchResults;
